<script>
  import anime from 'animejs/lib/anime.es.js';

  export default {
    name: "LoadingAnimation",
    mounted() {
      var tl = anime.timeline({
        targets: '.snd svg',
        easing: 'linear',
        duration: 1500,
        loop: true
      });

      tl.add({
        targets: '.snd #Animated g',
        translateY: 300,
        easing: 'easeOutExpo',
        delay: anime.stagger(200),
        opacity: 1
      }).add({
        translateY: 100,
        easing: 'easeInQuad',
        endDelay: 1000,
        duration: 800,
        opacity: 0
      }).add({
        translateY: 0,
        duration: 1
      }).add({
        targets: '.snd #Animated g',
        translateY: 0,
        duration: 1,
        opacity: 0
      }).add({
        duration: 400,
        opacity: 1
      });
    }
  }
</script>

<style scoped lang="scss">
  .snd {
    width: 200px;
    transform: translateY(-100px);
    text-align: center;

    #Animated g {
      opacity: 0;
    }

    h2 {
      animation: opacity-flash 4s infinite forwards;
    }
  }

  @keyframes opacity-flash {
    0% {
      opacity: 1;
    }
    50% {
      opacity: 0.5;
    }
    100% {
      opacity: 1;
    }
  }
</style>